const INITIAL_STATE = {
    sections: [
        {
            title: 'dairy',
            imageUrl: 'https://ibb.co/zRx3Mnd',
            id: 1,
            linkUrl: 'shop/dairy'
        },
        {
            title: 'bakery',
            imageUrl: 'https://ibb.co/MhPLmVc',
            id: 2,
            linkUrl: 'shop/bakery'
        },
        {
            title: 'meats',
            imageUrl: 'https://ibb.co/0XB57zL',
            id: 3,
            linkUrl: 'shop/meats'
        },
        {
            title: 'vegetables & fruits',
            imageUrl: 'https://ibb.co/PWb9cwF',
            size: 'large',
            id: 4,
            linkUrl: 'shop/vegetables'
        },
        {
            title: 'nuts',
            imageUrl: 'https://ibb.co/wrj0b4Y',
            size: 'large',
            id: 5,
            linkUrl: 'shop/nuts'
        }
    ]
}

const directoryReducer = (state = INITIAL_STATE, action) => {
    switch (action.type) {
        default:
            return state
    }
}

export default directoryReducer
